import React from "react";

export default function LandingPage({ onStart }) {
  return (
    <div
      style={{
        minHeight: "100vh",
        width: "100vw",
        background: "radial-gradient(ellipse at center, #cbe5ff 0%, #b3d1f7 60%, #a0c4f6 100%)",
        display: "flex",
        flexDirection: "column",
        alignItems: "center",
        justifyContent: "center",
        position: "relative",
        overflow: "hidden"
      }}
    >
      <div
        style={{
          background: "rgba(255,255,255,0.45)",
          borderRadius: "48px",
          boxShadow: "0 8px 64px 0 rgba(80,120,255,0.10)",
          padding: "64px 32px 48px 32px",
          maxWidth: 700,
          width: "90vw",
          textAlign: "center",
          margin: "0 auto"
        }}
      >
        <h1
          style={{
            fontSize: "3.2rem",
            fontWeight: 700,
            color: "#222",
            marginBottom: 24,
            lineHeight: 1.1
          }}
        >
          Automate Your Data Science.<br />From CSV to Insights.
        </h1>
        <div
          style={{
            fontSize: "1.25rem",
            color: "#444",
            marginBottom: 40,
            fontWeight: 400
          }}
        >
          Instantly turn your CSV files into clean, ready-to-use Jupyter notebooks.<br />
          AI-powered, multi-step pipelines for EDA, cleaning, feature engineering, and modelingâ€”no coding required.
        </div>
        <button
          onClick={onStart}
          style={{
            background: "#222",
            color: "#fff",
            fontSize: "1.2rem",
            border: "none",
            borderRadius: 32,
            padding: "18px 48px",
            fontWeight: 600,
            boxShadow: "0 2px 8px rgba(0,0,0,0.10)",
            cursor: "pointer",
            transition: "background 0.2s"
          }}
        >
          Get Started
        </button>
      </div>
    </div>
  );
}
